import React from "react";
import ReactDOM from "react-dom";
import "../App.css";
import Header from "./Header";
import "../componentCss/AboutMeCss.css";
import aboutMe from "../img/about-me.jpg";

class AboutMe extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="c-12 about-me-wrapper grid row wide">
        <div className="about-me-img c-6">
          <img src="../img/about-me.jpg" alt="no pic" />
        </div>
        <div className="c-6 about-me-content">
          <h1 className="about-me-intro">
            {" "}
            <Header title="Tôi là" titleEmph="Tùng" />{" "}
          </h1>
          <p className="about-me-describe">
            {" "}
            Hiện đang là sinh viên năm 2 tại trường Đại học Công nghệ thông tin
            - Đại học Quốc gia TPHCM. Tôi có niềm yêu thích với lập trình
            Front-end, và đã dành nhiều thời gian để rèn luyện cho mình những kỹ
            năng cần thiết. Tôi được đánh giá cao về khả năng tự học, kỷ luật
            bản thân, khả năng teamlead và phân bổ công việc{" "}
          </p>
          <div className="about-me-btn-zone">
            <button className="btn about-me-hire "> TUYỂN DỤNG TÔI </button>
            <button className="btn about-me-cv "> TẢI VỀ CV CỦA TÔI </button>
          </div>
        </div>
      </div>
    );
  }
}
export default AboutMe;
